def read_killed():
	global killed_dict
	killed_dict = {}
	with open(killed_mutants_dir) as f:
		reader = csv.DictReader(f);
		for row in reader:
			killed_dict[row['MutantNo']] = row['[FAIL | TIME | EXC | LIVE]']
	if debug:
		print(killed_dict)

def read_diff():
	global diffs_dict
	global class_name
	global class_path
	global method_name
	diffs_dict = {}
	with open(log_mutants_path) as f:
		rows = f.readlines()
		for row in rows:
			temp = row.split(":")
			diffs = temp[6].split("|==>")
			#store the values into a dict
			#mutant id, weird value?, Line of Code, before code, after code
			diffs_dict[temp[0]] = [temp[1],temp[5],diffs[0],diffs[1].rstrip()]
			#Only modify once and add the java class name being tested
			class_name = temp[4][temp[4].find(".")+1:temp[4].find("@")] if class_name == '' else class_name 
			class_path = temp[4][:temp[4].find("@")].replace('.','/').replace(class_name,'') if class_path == '' else class_path 
			method_name = temp[4][temp[4].find("@")+1:] if method_name == '' else method_name
	class_name += '.java'
	if debug:
		print(diffs_dict['125'])
		print(len(diffs_dict))

def add_data():
	global html_summary
	global html_table_rows_built
	global html_footer
	#replace using reduce
	repls1 = {'TOTAL_MUTANTS' : summary_dict['MutantsGenerated'], 'TOTAL_TIME' : summary_dict['RuntimeAnalysisSeconds'],'CLASS_NAME' : class_name,
	'ORIGINAL_SOURCE_CODE' : original_source_file,'METHOD_NAME': method_name}
	html_summary = reduce(lambda a, keyvalue: a.replace(*keyvalue), repls1.iteritems(), html_summary)
